    <Map className="map" style={{'borderRadious':'25px'}} height={'87.5vh'} defaultCenter={[50.879, 4.6997]} defaultZoom={11}>
      <Marker width={50} anchor={[50.879, 4.6997]} />
    </Map>
  )
}

export default MapBox;
